public class Task {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		//print odd numbers
		
		for(int a=21; a<=50; a+=2) {
			System.out.println(a);
		}
		
		//what is the output
		
		int total=2;
		for(int k=1; k<4; k++) {
			total=total*k;
		}
		System.out.println(total);
	}
}
